con:configuration.script:
def workspace = context.expand('${workspaceDir}')
//return workspace
def env = testRunner.testCase.testSuite.project.activeEnvironment.name
def project = testRunner.testCase.testSuite.project.name
def contentLibraryMemResult = context.expand( '${#Project#contentLibraryMemResult}' )

if(contentLibraryMemResult=='win')
{
	def path = workspace+"\\Results\\"+env+"\\V1\\"+project+"\\"+project+"Result.csv"
	return path
}
else if(contentLibraryMemResult=='mac')
{
	def path = workspace+"/Results/"+env+"/V1/"+project+"/"+project+"Result.csv"
	return path
}
else
{
	return contentLibraryMemResult
}

